import styled, { keyframes } from "styled-components";

const CapImage = styled.image`
  transition-duration: 1s;
  transform-origin: 20% 20%;
  :hover {
    transform: rotateX(31deg) rotateY(-61deg);
  }
`;

function App() {
  return (
    <div style={{ width: "100vw", height: "100vh" }}>
      <svg x="0px" y="0px" width="70%" height="70%" viewBox="0 0 1786 2971">
        <image
          width="100%"
          height="100%"
          x="0"
          y="0"
          href="../body1.svg"
        ></image>
        <CapImage
          width="100%"
          height="40%"
          x="0px"
          y="0px"
          href="../cap.svg"
        ></CapImage>
      </svg>
    </div>
  );
}

export default App;
